import React from 'react';
import Banner from './components/Banner';
import About from './components/About';
import SwapAndSocials from './components/SwapAndSocials';
import Gallery from './components/Gallery';
import Footer from './components/Footer';

function App() {
  return (
    <div className="min-h-screen">
      {/* Banner section */}
      <div style={{
        background: 'linear-gradient(to bottom, #fee7bf 0%, #ffa6b0 50%, #fcc0c3 100%)'
      }}>
        <Banner />
      </div>
      
      {/* About section with gradient transition */}
      <div style={{
        background: 'linear-gradient(to bottom, #fcc0c3 0%, #f17f7f 50%, #f5a1a1 100%)'
      }}>
        <About />
      </div>
      
      {/* SwapAndSocials section with gradient transition */}
      <div style={{
        background: 'linear-gradient(to bottom, #f5a1a1 0%, #f17f7f 50%, #ffa6b0 100%)'
      }}>
        <SwapAndSocials />
      </div>
      
      {/* Gallery section with gradient transition */}
      <div style={{
        background: 'linear-gradient(to bottom, #ffa6b0 0%, #f17f7f 50%, #bd4b4b 100%)'
      }}>
        <Gallery />
      </div>
      
      {/* Footer section */}
      <div style={{
        background: 'linear-gradient(to bottom, #bd4b4b 0%, #bd4b4b 100%)'
      }}>
        <Footer />
      </div>
    </div>
  );
}

export default App;
